// src/firebase.js
import { initializeApp } from "firebase/app";
import { getAuth } from "firebase/auth";

const firebaseConfig = {
  apiKey: "AIzaSyDJI4o4Uu5otjFmVoqIdl1iNkisoj61Ge4",                // Replace with your API key
  authDomain: "YOUR_AUTH_DOMAIN",        // Replace with your authDomain
  projectId: "studbuds-60a97",          // Replace with your project ID
  storageBucket: "YOUR_STORAGE_BUCKET",  // Replace with your storage bucket
  messagingSenderId: "YOUR_MESSAGING_SENDER_ID", // Replace with your sender ID
  appId: "YOUR_APP_ID"                   // Replace with your app ID
};

const app = initializeApp(firebaseConfig);
export const auth = getAuth(app);
